package com.ltcn272.finy.data.source.remote.user.api

import com.ltcn272.finy.data.source.remote.user.dto.UserProfileDto
import retrofit2.Response
import retrofit2.http.GET
import retrofit2.http.PUT
import retrofit2.http.Body

interface UserApi {
    @GET("user/profile")
    suspend fun getProfile(): Response<UserProfileDto>

    @PUT("user/profile")
    suspend fun updateProfile(@Body body: UserProfileDto): Response<UserProfileDto>
}
